import styled, { createGlobalStyle } from "styled-components";

export default createGlobalStyle`
*{
  margin: 0;
  padding: 0;
  box-sizing: border-box;
}

li{
  list-style: none;
}

body{
  background-color: ${({theme}) => theme.body};
  color: ${({theme}) => theme.text}; 
  width: 650px;
  margin: 120px auto;
}


`;

export const Container = styled.div`
  width: 650px;
  margin: 120px auto;

`


